import React, { useState } from 'react';
import { Route, Routes, useLocation } from 'react-router-dom';
import Home from './components/Home';
import Login from './components/Login';
import Register from './components/Register';
import ArtworkList from './components/ArtworkList';
import AdminHomePage from './Admin/AdminHomePage';
import ArtistHomePage from './Artist/ArtistHomePage';
import CuratorHomePage from './Curator/CuratorDashboard';
import VisitorHomePage from './Visitor/VisitorHomePage';
import CartPage from './components/CartPage';
import AboutPage from './components/About';
import ManageUsers from './Admin/ManageUsers';
import ManageArtworks from './Admin/ManageArtworks';
import SiteSettings from './Admin/SiteSettings';
import ExhibitionHighlights from './Curator/ExhibitionHighlights';
import VisitorFeedback from './Curator/VisitorFeedback';
import ArtworkInsights from './Curator/ArtworkInsights'; // Import the Artwork Insights component
import GalleryContentManagement from './Curator/GalleryContentManagement'; // Import the Gallery Content Manager component
import ManageArtworks1 from './Curator/ManageArtworks1'; // Import the Manage Artworks component
import OrganizeExhibitions from './Curator/OrganizeExhibitions'; // Import the Organize Exhibition component

// Import Navbars
import Navbar from './components/Navbar';
import AdminNavbar from './components/AdminNavbar';
import ArtistNavbar from './components/ArtistNavbar';
import CuratorNavbar from './components/CuratorNavbar';

const App = () => {
  const [cartItems, setCartItems] = useState([]);
  const location = useLocation();

  // Function to determine which navbar to display based on the current route
  const getNavbar = () => {
    if (location.pathname.startsWith('/admin')) return <AdminNavbar />;
    if (location.pathname.startsWith('/artist')) return <ArtistNavbar />;
    if (location.pathname.startsWith('/curator')) return <CuratorNavbar />;
    return <Navbar />; // Default to Visitor Navbar
  };

  return (
    <div>
      {getNavbar()} {/* Display the appropriate navbar based on the route */}
      <Routes>
        {/* Main Routes */}
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<AboutPage />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/artworks" element={<ArtworkList setCartItems={setCartItems} cartItems={cartItems} />} />
        <Route path="/cart" element={<CartPage cartItems={cartItems} setCartItems={setCartItems} />} />

        {/* Admin Routes */}
        <Route path="/admin" element={<AdminHomePage />} />
        <Route path="/admin/manage-users" element={<ManageUsers />} />
        <Route path="/admin/manage-artworks" element={<ManageArtworks />} />
        <Route path="/admin/site-settings" element={<SiteSettings />} />

        {/* Artist Routes */}
        <Route path="/artist" element={<ArtistHomePage />} />

        {/* Curator Routes */}
        <Route path="/curator" element={<CuratorHomePage />} />
        <Route path="/curator/exhibition-highlights" element={<ExhibitionHighlights />} />
        <Route path="/curator/visitor-feedback" element={<VisitorFeedback />} />
        <Route path="/curator/artwork-insights" element={<ArtworkInsights />} /> {/* New route */}
        <Route path="/curator/gallery-content-manager" element={<GalleryContentManagement />} /> {/* New route */}
        <Route path="/curator/manage-artworks" element={<ManageArtworks1 />} /> {/* New route */}
        <Route path="/curator/organize-exhibition" element={<OrganizeExhibitions />} /> {/* New route */}

        {/* Visitor Route */}
        <Route path="/visitor" element={<VisitorHomePage />} />
      </Routes>

      {/* Footer */}
      <footer style={{ textAlign: 'center', marginTop: '20px', padding: '10px', backgroundColor: '#f8f9fa' }}>
        <p>&copy; {new Date().getFullYear()} Art Gallery. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default App;
